import React from 'react'
import './styles/App.css'
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import About from './pages/About';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/about">
          <About />
        </Route>
      </Routes>
    </Router>
  )

}

export default App;
